import { createSlice } from '@reduxjs/toolkit';

const initially={
   isData:{}
}
const searchSlice=createSlice({
    name:'searchnames',
    initialState:initially,
    reducers:{
        searchnames(state,action){
            state.isData=action.payload;
        }
    }


})


export const searchData=searchSlice.actions;
